p_03.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);

            {
                if (normalizedValue != 0.0) {
                    normalizedValue = rnbo_exp(
                        rnbo_log((normalizedValue <= 0.0000000001 ? 0.0000000001 : normalizedValue)) * 1. / 0.8
                    );
                }
            }

            return normalizedValue;
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 5000 ? 5000 : value));
            let normalizedValue = (value - 0) / (5000 - 0);

            {
                if (normalizedValue != 0.0) {
                    normalizedValue = rnbo_exp(
                        rnbo_log((normalizedValue <= 0.0000000001 ? 0.0000000001 : normalizedValue)) * 1. / 3
                    );
                }
            }

            return normalizedValue;
        }
    case 1:
        {
            value = (value < 1 ? 1 : (value > 5000 ? 5000 : value));
            let normalizedValue = (value - 1) / (5000 - 1);

            {
                if (normalizedValue != 0.0) {
                    normalizedValue = rnbo_exp(
                        rnbo_log((normalizedValue <= 0.0000000001 ? 0.0000000001 : normalizedValue)) * 1. / 3
                    );
                }
            }

            return normalizedValue;
        }
    case 3:
        {
            value = (value < 1 ? 1 : (value > 90000 ? 90000 : value));
            let normalizedValue = (value - 1) / (90000 - 1);

            {
                if (normalizedValue != 0.0) {
                    normalizedValue = rnbo_exp(
                        rnbo_log((normalizedValue <= 0.0000000001 ? 0.0000000001 : normalizedValue)) * 1. / 5
                    );
                }
            }

            return normalizedValue;
        }
    default:
        return value;
    }
}

p_03.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 2:
        {
            {
                if (value == 0.0) {
                    return 0;
                } else {
                    return 0 + rnbo_exp(rnbo_log((value <= 0.0000000001 ? 0.0000000001 : value)) * 0.8) * (1 - 0);
                }
            }
        }
    case 0:
        {
            {
                if (value == 0.0) {
                    return 0;
                } else {
                    return 0 + rnbo_exp(rnbo_log((value <= 0.0000000001 ? 0.0000000001 : value)) * 3) * (5000 - 0);
                }
            }
        }
    case 1:
        {
            {
                if (value == 0.0) {
                    return 1;
                } else {
                    return 1 + rnbo_exp(rnbo_log((value <= 0.0000000001 ? 0.0000000001 : value)) * 3) * (5000 - 1);
                }
            }
        }
    case 3:
        {
            {
                if (value == 0.0) {
                    return 1;
                } else {
                    return 1 + rnbo_exp(rnbo_log((value <= 0.0000000001 ? 0.0000000001 : value)) * 5) * (90000 - 1);
                }
            }
        }
    default:
        return value;
    }
}

p_03.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 5000 ? 5000 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 5000 ? 5000 : (v < 1 ? 1 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 90000 ? 90000 : (v < 1 ? 1 : v));
            return v;
        }
    default:
